import React from 'react';
import './App.css';
import VideoPlayer from './VideoPlayer';
import data from './data';

function App() {
  return (
    <div className="app">
      <div className="video-feed">
        {data.map((item, index) => (
          <VideoPlayer key={index} videoSrc={item.videoSrc} />
        ))}
      </div>
    </div>
  );
}

export default App;
